import React from 'react'
import subscriptions from '../subscriptions'
import { Row,Col } from 'react-bootstrap'

const Home = () => {
    return (
        <div>
            <Row>
                {subscriptions.map(subscription =>(
                    <Col sm={12} md={6} xl={3}>
                        <h3>{subscription.name}</h3>
                    </Col>
                ))}
            </Row>
        </div>
    )
}

export default Home
